     &   F1*CKM(gno1,Ind1)*CKMC(gno2,Ind2)*MCha(Cha4)*MCha(Cha5)*
     &     Mf(tH,gno2)*Sub624(All4,Cha4,Ind1)*UASf(All4,Ind2,bH)*
     &     VCha(Cha5,2) + F2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &     MCha2(Cha4)*Mf(tH,gno1)*Sub700(All4,Cha5,Ind1)*
     &     UASfC(All4,Ind2,bH)*VChaC(Cha4,2)

	Sub714(All4,Cha4,Cha5,Ind1,Ind2) = 
     &   F1*CKM(gno1,Ind1)*CKMC(gno2,Ind2)*MCha2(Cha4)*Mf(tH,gno2)*
     &     Sub624(All4,Cha4,Ind1)*UASf(All4,Ind2,bH)*VCha(Cha5,2)+
     &      F2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*MCha(Cha4)*
     &     MCha(Cha5)*Mf(tH,gno1)*Sub700(All4,Cha5,Ind1)*
     &     UASfC(All4,Ind2,bH)*VChaC(Cha4,2)

	Sub715(All4,Cha4,Cha5,Ind1,Ind2) = 
     &   Sub143(Cha4,Cha5)*Sub713(All4,Cha4,Cha5,Ind1,Ind2) + 
     &    Sub148(Cha4,Cha5)*Sub714(All4,Cha4,Cha5,Ind1,Ind2)

	Sub716(All4,Cha4,Cha5,Ind1,Ind2) = 
     &   (2*(1/sqrt2*(F1*m2*S2B*CKM(gno1,Ind1)*CKMC(gno2,Ind2)*
     &           MCha(Cha4)*Mf(tH,gno1)*Mf(tH,gno2)*
     &           Sub148(Cha4,Cha5)*UASf(All4,Ind2,bH)*
     &           UASfC(All4,Ind1,bH)*VCha(Cha5,2)*VChaC(Cha4,2)) + 
     &        SB2*Sub715(All4,Cha4,Cha5,Ind1,Ind2)))/(S2B*SB2)

	Sub717(All4,Cha4,Cha5,Ind1,Ind2) = 
     &   sqrt2*(MCha(Cha4)*Sub712(All4,Cha4,Cha5,Ind1,Ind2)) + 
     &    2*Sub716(All4,Cha4,Cha5,Ind1,Ind2)

	Sub718(All4,Cha4,Cha5,Ind1,Ind2) = 
     &   decczero*(C0i33(Epsi(cc2),All4,Cha4,Cha5)*
     &       Sub707(All4,Cha4,Cha5,Ind1,Ind2) + 
     &      C0i33(Epsi(cc1),All4,Cha4,Cha5)*
     &       Sub711(All4,Cha4,Cha5,Ind1,Ind2) + 
     &      C0i33(Epsi(cc0),All4,Cha4,Cha5)*
     &       Sub717(All4,Cha4,Cha5,Ind1,Ind2))

	ENDLOOP(Ind2)
	ENDLOOP(Ind1)
	ENDLOOP(Cha5)
	ENDLOOP(Cha4)
	ENDLOOP(All4)

	LOOP(All4, 1,6,1)
	LOOP(All5, 1,6,1)
	LOOP(Cha4, 1,2,1)
	LOOP(Ind1, 1,3,1)
	LOOP(Ind2, 1,3,1)
	LOOP(Ind3, 1,3,1)
	LOOP(Ind4, 1,3,1)

	Sub647(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(F2*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &         Sub625(All5,Cha4,Ind1)*Sub638(All4,All5,Ind3,Ind4)*
     &         Sub639(All4,Cha4,Ind2) + 
     &        2*CB2*F1*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &         Mf(tH,gno2)*Sub646(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &         VChaC(Cha4,2)))/S2B**2

	Sub658(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(F2*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &         Sub625(All5,Cha4,Ind1)*Sub639(All4,Cha4,Ind2)*
     &         Sub650(All4,All5,Ind3,Ind4) + 
     &        2*CB2*F1*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &         Mf(tH,gno2)*Sub657(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &         VChaC(Cha4,2)))/S2B**2

	Sub659(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub647(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub658(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

	Sub664(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   4*cI*(3*F2*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &        Sub625(All5,Cha4,Ind1)*Sub639(All4,Cha4,Ind2)*
     &        Sub660(All4,All5,Ind3,Ind4) + 
     &       6*CB2*F1*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &        Mf(tH,gno2)*Sub663(All4,All5,Ind1,Ind2)*
     &        UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &        VChaC(Cha4,2))/S2B**2

	Sub665(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (Sub659(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &      CB*CW*Sub664(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &       XHiggs(hno,3,uzext1))/(CB*CW)

	Sub666(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(F1*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &         Sub625(All5,Cha4,Ind1)*Sub638(All4,All5,Ind3,Ind4)*
     &         Sub639(All4,Cha4,Ind2) + 
     &        2*CB2*F2*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &         Mf(tH,gno2)*Sub646(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &         VChaC(Cha4,2)))/S2B**2

	Sub667(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(F1*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &         Sub625(All5,Cha4,Ind1)*Sub639(All4,Cha4,Ind2)*
     &         Sub650(All4,All5,Ind3,Ind4) + 
     &        2*CB2*F2*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &         Mf(tH,gno2)*Sub657(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &         VChaC(Cha4,2)))/S2B**2

	Sub668(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub666(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub667(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

	Sub669(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   4*cI*(3*F1*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &        Sub625(All5,Cha4,Ind1)*Sub639(All4,Cha4,Ind2)*
     &        Sub660(All4,All5,Ind3,Ind4) + 
     &       6*CB2*F2*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &        Mf(tH,gno2)*Sub663(All4,All5,Ind1,Ind2)*
     &        UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &        VChaC(Cha4,2))/S2B**2

	Sub670(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (Sub668(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &      CB*CW*Sub669(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &       XHiggs(hno,3,uzext1))/(CB*CW)

	Sub671(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   decczero*(m2*C0i1(Epsi(cc1),All4,All5,Cha4)*
     &       Sub665(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &      m3*C0i1(Epsi(cc2),All4,All5,Cha4)*
     &       Sub670(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4))

	ENDLOOP(Ind4)
	ENDLOOP(Ind3)
	ENDLOOP(Ind2)
	ENDLOOP(Ind1)
	ENDLOOP(Cha4)
	ENDLOOP(All5)
	ENDLOOP(All4)

	end

